import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Main from "./pages/Main"
import Catalog from "./components/menu/catalog"

function App() {
  return (
    <div>
      <Catalog/>
      <Router>
        <Switch>
          <Route path='/' component={Main}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
